# 训练
train_data = {
    "single_qa": parse_head_data(single_qa_training),
    "multihop": parse_head_data(MultiHop_QA_training),
    "code": parse_head_data(Code_training),
    "sum": parse_head_data(Summarization_training),
}

# 推理
test_data = {
    "single_qa": parse_head_data(single_qa_test),
    "multihop": parse_head_data(Multihop_qa_test),
    "code": parse_head_data(Code_test),
    "sum": parse_head_data(Summarization_test),
}

# 转为 sparsity mask
train_mask = {k: extract_sparsity_mask(v) for k, v in train_data.items()}
test_mask  = {k: extract_sparsity_mask(v) for k, v in test_data.items()}


tasks = ["single_qa", "multihop", "code", "sum"]
n = len(tasks)

sim_test = np.zeros((n, n))

for i, t1 in enumerate(tasks):
    for j, t2 in enumerate(tasks):
        sim_test[i, j] = jaccard_similarity(
            test_mask[t1],
            test_mask[t2]
        )

plt.figure(figsize=(6, 5))
sns.heatmap(
    sim_test,
    xticklabels=tasks,
    yticklabels=tasks,
    annot=True,
    cmap="YlOrRd",
    vmin=0, vmax=1
)
plt.title("Inference: Sparsity-Head Pattern Similarity (Jaccard)")
plt.tight_layout()
plt.savefig("inference_similarity.png")
plt.show()


sim_train_test = []

for t in tasks:
    sim = jaccard_similarity(
        train_mask[t],
        test_mask[t]
    )
    sim_train_test.append(sim)

sim_train_test = np.array(sim_train_test).reshape(-1, 1)

plt.figure(figsize=(4, 5))
sns.heatmap(
    sim_train_test,
    yticklabels=tasks,
    xticklabels=["Train vs Test"],
    annot=True,
    cmap="YlGn",
    vmin=0, vmax=1
)
plt.title("Train–Inference Sparsity-Head Consistency")
plt.tight_layout()
plt.savefig("train_vs_test_similarity.png")
plt.show()
